import React from "react";
import Map from "../Images/moscumapa.jpeg";

const Bookings = () => {
  return (
    <div className="bg-black md:pb-96">
      <h1 className="text-white sm:text-4xl ms-11 relative text-center">
        DO YOUR BOOKINGS HERE!
      </h1>

      <div className="sm:w-6/12 sm:ms-96 sm:-mt-72 md:rotate-90">
        <img src={Map} alt="mapa" />
      </div>
      <div>
        <h3 className="md:text-4xl md:-mt-60 md:mb-24 text-white text-center">
          LISTA DE MESAS DISPONIBLES
        </h3>
        <ul className="columns-5 ms-10">
          <h1 className="text-white text-3xl">ULTRA VIP</h1>
          <h1 className="text-white text-3xl">PISTA GENERAL</h1>
          <h1 className="text-white text-3xl">VIP</h1>
          <h1 className="text-white text-3xl">TERRAZA VIP</h1>
          <h1 className="text-white text-3xl">ULTRA VIP</h1>
        </ul>
      </div>
    </div>
  );
};

export default Bookings;
